/** Dependencies */
import { NodeBlock, Slots, slots, tripetto } from "tripetto";

@tripetto({
    type: "node",
    identifier: "process-task",
    label: "Process Task",
    icon: "data:image/png;base64,"
})
export class ProcessTask extends NodeBlock {
    processTaskSlot!: Slots.Boolean;

    @slots
    defineSlot(): void {
        this.processTaskSlot = this.slots.static({
            type: Slots.Boolean,
            reference: "process-task-slot",
            label: "Process Task slot"
        });
    }
}